import React from "react";
import ReactDOM from "react-dom";
const time = new Date().toLocaleTimeString();
if (time < 12) {
  console.log("Good Evening");
} else {
  console.log("Good Night");
} 

ReactDOM.render(
  <>
    <h1>Current Time Is : {`${time}`}</h1>
  </>,
  document.getElementById("root")
);
